import './menu.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import React, { useState } from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import { Link } from 'react-router-dom';



const NavigationBar = () => {
    return (
      // Barra de navegación utilizando React Bootstrap
      <Navbar expand="lg" bg="dark" data-bs-theme="dark" className="bg-body-tertiary">
        <Container fluid>
          {/* Marca del sitio */}
          <Navbar.Brand>ClaseYA</Navbar.Brand>
          <Navbar.Toggle aria-controls="navbarScroll" />
          <Navbar.Collapse id="navbarScroll">
            {/* Menú de navegación */}
            <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }} navbarScroll>
              {/* Enlace de inicio (utilizando react-router-dom) */}
              <Nav.Link as={Link} to="/">Home</Nav.Link>
              {/* Enlace de perfil */}
              <Nav.Link as={Link} to="/perfil">Perfil</Nav.Link>
              {/* Enlace de historial (utilizando react-router-dom) */}
              <Nav.Link as={Link} to="/historial">Historial</Nav.Link>
              {/* Enlace para iniciar sesión */}
              <Nav.Link as={Link} to="/iniciarsesion">Iniciar sesión</Nav.Link>
            </Nav>
            {/* Formulario de búsqueda */}
            <Form className="d-flex">
              <Form.Control
                type="search"
                placeholder="Buscar por categoria"
                className="me-2"
                aria-label="Buscar"
              />
              <Button variant="light">Buscar</Button>
            </Form>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    );
  }

  export default NavigationBar;
